import React, { Fragment } from 'react';
import AppMap from './Appmap';

const Appass = (props) => {
  //console.log(props.TodoPass);
    return (
        <Fragment>
          <h1>I am from props. ismail</h1>
          {
            props.TodoPass.map((axtra) => (
               <AppMap axtr={axtra.axtra} key={axtra.id} />
            ))}
        </Fragment>
    );
};
export default Appass;
